int[] arr = { 10, 12, 5, 17, 14 };
int min = arr[0];
int max = arr[0];
for (int i = 0; i < arr.Length; i++)
{
if (arr[i] < min) { min = arr[i]; }
if (arr[i] > max) { max = arr[i]; }
}
int sum = min + max;
Console.WriteLine(sum);

